import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Select from './components/Select';
import Page from './components/Page';
import NotFound from './components/NotFound';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Switch>
          <Route path="/select">
            <Select />
          </Route>
          <Route path="/">
            <Page />
          </Route>
          <Route exact path="*">
            <NotFound />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
